var b="url",c="1控制台.html",d="generationDate",e=new Date(1523495483915.85),f="isCanvasEnabled",g=false,h="isAdaptiveEnabled",i="variables",j="Systemchoice",k="Systemchoicefirstpage",l="fenping",m="yuanbaocunwenben",n="page",o="packageId",p="a5951f3f47fb4064b78852abdd239170",q="type",r="Axure:Page",s="name",t="1控制台",u="notes",v="1、原型操作说明一",w="<p><span>A、</span><span>前提1：</span></p><p><span>大屏开启，控制台与大屏矩阵、系统之间通信正常，且大屏上尚未有系统进行展示</span><span>。</span></p><p><span><br></span></p><p><span>B、原型交互点：</span></p><p><span>数据可视化系统图标、主题一图标、返回上一页图标；</span></p><p><span><br></span></p><p><span>C</span><span>、原型演示</span><span>操作</span><span>路径</span><span>：</span></p><p><span>①打开登录页面——&gt;点击“登录”按钮——&gt;进入</span><span>控制台</span><span>【首页】；</span></p><p><span>②点击【首页】上的任一系统图标或名称，可进入对应系统下级菜单，在下级菜单中点击“返回上一级”可返回对应层级菜单，</span><span>注意：</span><span>此部分操作不会触发显示指令给大屏幕；</span></p><p><span>③点击【首页】左侧边栏展开按钮，在弹出的菜单中点击【分屏】按钮，进入分屏控制模式；</span></p><p><span>④在</span><span>【</span><span>分屏控制页</span><span>】</span><span>，点击下方的各分屏</span><span>示意</span><span>，可将屏幕分割命令发布给矩阵进行大屏分割，此时</span><span>大屏上</span><span>各屏幕均为无信号状态；</span></p><p><span>⑤点击</span><span>【</span><span>分屏控制页】中</span><span>任一屏幕中的“无信号”字体，控制台可控制</span><span>对应大屏幕上对应</span><span>屏幕显示，</span><span>控制台页面从【分屏控制页】</span><span>返回到【首页】，通过选择系统，将被选择的系统信号投放到该屏幕</span><span>，大屏幕上对应屏幕同步执行对应指令执行后的结果；</span><span>在控制页，点击左侧边栏的展开按钮，点击“分屏”按钮，可返回分屏模式</span><span>，并记录当前操作结果</span><span>；</span></p><p><span><br></span></p>",x="style",y="baseStyle",z="627587b6038d43cca051c114ac41ad32",A="pageAlignment",B="near",C="fill",D="fillType",E="solid",F="color",G=0xFFFFFFFF,H="image",I="imageHorizontalAlignment",J="imageVerticalAlignment",K="imageRepeat",L="auto",M="favicon",N="sketchFactor",O="0",P="colorStyle",Q="appliedColor",R="fontName",S="Applied Font",T="borderWidth",U="adaptiveStyles",V="interactionMap",W="diagram",X="objects",Y="id",Z="d421088e54064e12bc76a575f497d88c",ba="label",bb="",bc="friendlyType",bd="背景底板",be="referenceDiagramObject",bf="styleType",bg="visible"